	(3, 2, 1, '1.1.1', 'Tỷ lệ người có việc làm trên dân số trong độ tuổi lao động có khả năng tham gia lao động từ 90% trở lên (nếu không đạt thì chấm 0 điểm)', 0.5, 0.5, 3, 1, 'AND', 2, 'Select', 1, 1, '2024-09-09 21:23:53', '2024-09-10 00:47:07'),
	(4, 2, 1, '1.1.2', 'Thu nhập bình quân đầu người bằng hoặc cao hơn thu nhập bình quân đầu người của toàn huyện, thành phố (nếu không đạt thì chấm 0 điểm)', 0, 0.5, 2, 1, 'AND', 2, 'Select', 1, 1, '2024-09-09 21:24:48', '2024-09-10 00:47:29'),
