	(7, 1, 1, '1.3', 'Phát triển ngành nghề truyền thống hoặc có đóng góp về văn hóa, công nghệ, khoa học kỹ thuật cho địa phương', 0, 0, 5, 1, 'OR', 1, NULL, 1, 1, '2024-09-10 00:36:37', '2024-09-10 00:50:32'),
